      "method": "GET",
      "headers": {
        "x-api-key": "82dbeaac7b3078a26ab28e0736ecf8ee",
        "x-rapidapi-key": "SIGN-UP-FOR-KEY",
        "x-rapidapi-host": "documenu.p.rapidapi.com"
      }
    })
    .then(response => {
      console.log(response);
    })
    .catch(err => {
      console.error(err);
    });
  }, []);

  return (<Frontend />);
}


export default App;
